import React from "react";
import "./Setting_up.css";
import deski_ash from "../assets/deski_ash.svg";

function Setting_up() {
    return (
        <div>
            <div className="login">
                <img src={deski_ash} alt="" className="login_logo" height="70" width="110" />
            </div>
        </div>
    );
}

export default Setting_up;
